update request_info set is_canceled = 'N' where req_no % 2 = 1;


UPDATE seller_info s
LEFT JOIN (
    SELECT seller_no, COUNT(*) AS proposal_count
    FROM proposal_info
    GROUP BY seller_no
) p ON s.seller_no = p.seller_no
LEFT JOIN (
    SELECT seller_no, COUNT(*) AS review_count
    FROM review_info
    GROUP BY seller_no
) r ON s.seller_no = r.seller_no
LEFT JOIN (
    SELECT seller_no, COUNT(*) AS like_count
    FROM like_info
    GROUP BY seller_no
) l ON s.seller_no = l.seller_no
SET s.seller_grade = CASE
    WHEN s.seller_portfolio IS NOT NULL OR s.seller_introduce IS NOT NULL THEN
        CASE
			WHEN p.proposal_count >= 100 AND r.review_count >= 30 AND l.like_count >= 300 THEN 'SuperDiamond'
            WHEN p.proposal_count >= 30 AND r.review_count >= 10 AND l.like_count >= 100 THEN 'Diamond'
            WHEN p.proposal_count >= 10 AND r.review_count >= 5 AND l.like_count >= 30 THEN 'Gold'
            WHEN p.proposal_count >= 1 AND r.review_count >= 1 AND l.like_count >= 5 THEN 'Silver'
            ELSE 'Bronze'
        END
    ELSE 'Iron'
END;


SELECT ri.*,
       (SELECT COUNT(*) FROM proposal_info WHERE req_no = ri.req_no) AS proposal_count
FROM request_info ri
JOIN like_info li ON ri.cust_no = li.cust_no
LEFT JOIN proposal_info pi ON ri.req_no = pi.req_no
JOIN customer_info ci ON ri.cust_no = ci.cust_no
JOIN seller_info si ON li.seller_no = si.seller_no
WHERE ri.is_canceled = 'N'
  AND ri.is_completed = 'N'
  AND li.seller_no = 5
  AND (pi.is_chosen = 'N' OR pi.is_chosen IS NULL)
ORDER BY
  CASE
    WHEN SUBSTRING_INDEX(si.seller_addr, ' ', 1) = SUBSTRING_INDEX(ci.cust_addr, ' ', 1) THEN 1
    ELSE 2
  END,
  YEAR(ri.created_at) DESC,
  (SELECT COUNT(*) FROM request_info ri_sub WHERE ri_sub.cust_no = ri.cust_no AND ri_sub.is_completed = 'Y') DESC,
  ri.created_at DESC
LIMIT 3;
