---------------------------------------------------------------------------------------------------------------------------------------------------------------------
--------------------------------------------------------------------  추천 생성  -------------------------------------------------------------------------------------
---------------------------------------------------------------------------------------------------------------------------------------------------------------------

--- 추천 ---
-- 조건1 : 테이블 request_info 의 속성 is_canceled 는 'N'이어야 한다. -> 의뢰가 최소된 의뢰는 추천해줄 수 없기 때문
-- 조건2 : 테이블 request_info 의 속성 is_completed 는 'N'이어야 한다. -> 의뢰가 이미 성사된 의뢰는 추천해줄 수 없기 때문
-- 조건3 : 테이블 proposal_info에 있는 is_chosen은 'N'이어야 한다. -> 위와 마찬가지로 제안이 채택된 의뢰는 추천해 줄 수 없기 때문
-- 조건4(대전제) : seller에게 추천해줄 때 seller를 like(찜)한 customer가 올린 request를 보여준다. -> 대전제
-- 조건5(정렬) : 조건 4를 만족함과 동시에 seller 랑 customer의 주소 도나 시가 같다면 우선적으로 보여준다. -> 전제1
-- 조건6(정렬) : 조건 4를 만족함과 동시에 조건 5에 해당되는 인스턴스가 출력 인스턴스보다 작다면 customer의 request가 completed 된 수가 많은 customer 부터 정렬한다.
-- 조건7(정렬) : 가장 최근에 올라온 request(의뢰서) 순으로 보여준다.

-- seller_no속성이 1이고 seller_no를 like한 customer가 올린 request를 보여주고 is_canceled랑 is_compeleted가 'N'이고 (의뢰가 취소되거나 수락된 의뢰면 안되기 때문에)
-- customer가 요청한 req_no가 proposal_info에 있는데 이 테이블안에서 is_chosen이 'N'인 request 중 가장 최근에 요청한 5개

-- 판매자와 구매자의 주소의 첫 단어가 일치하는 경우 우선적으로 정렬.
-- created_at의 연도가 같은 경우 우선적으로 정렬.
-- request_info 테이블에서 해당 cust_no가 가진 is_completed가 'Y'인 수가 많은 순으로 정렬.
-- 최종적으로 최근 순으로 정렬.


SELECT ri.*
FROM request_info ri
JOIN like_info li ON ri.cust_no = li.cust_no
LEFT JOIN proposal_info pi ON ri.req_no = pi.req_no
JOIN customer_info ci ON ri.cust_no = ci.cust_no
JOIN seller_info si ON li.seller_no = si.seller_no
WHERE ri.is_canceled = 'N' 
    AND ri.is_completed = 'N'
    AND li.seller_no = 2
    AND (pi.is_chosen = 'N' OR pi.is_chosen IS NULL)
ORDER BY 
    -- 주소의 첫 단어가 일치하는 경우 우선적으로 정렬
    CASE 
        WHEN SUBSTRING_INDEX(si.seller_addr, ' ', 1) = SUBSTRING_INDEX(ci.cust_addr, ' ', 1) THEN 1
        ELSE 2
    END,
    -- 연도가 같은 경우 우선 정렬
    YEAR(ri.created_at) DESC,
    -- 연도가 같은 경우 is_completed 'Y'인 수가 많은 순으로 정렬
    (SELECT COUNT(*)
     FROM request_info ri_sub
     WHERE ri_sub.cust_no = ri.cust_no
       AND ri_sub.is_completed = 'Y') DESC,
    -- 최종적으로 최근 순으로 정렬
    ri.created_at DESC
LIMIT 3;



